import React, { Component } from 'react';


class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button"
     };


    render() { 
        return ( 
        <div>
            <span>Hello {this.state.name}</span> 
            <button className="btn btn-outline-success btn-sm m-2">{this.state.bttext}</button>
            <div class="d-flex justify-content-center">I'm an inline flexbox container!</div>

        </div>
        );
    }
}

export default Far;
